import React from 'react';
import '../App.css';
import './CollisionVisualizer.css';

export default class CollisionVisualizer extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            array: [],
        }
    }

    componentDidMount() {
        const array = [];

        for (let i = 0; i < 100; i++) {
            array.push('black');
        }
        this.setState({array});
    }

    

    render() {
        const {array} = this.state;

        return (
            <div className="collision-container">
                <div className="table-container">
                    <table>
                        <tbody>
                            {array.map((value, idx) => (
                                <tr key={idx}>
                                    {array.map((value, idx) => ( <td key={idx} style = {{background: `${value}`}}></td> ))}
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </div>
        );
    }
}
